data:
projects : Sentiment Analysis App-Python, Flask, ReactJS, Hugging Face Transformers, Flask-CORS, SciPy-Developed a responsive web app with ReactJS and Flask to analyze sentiment of user-input text using a pre-trained RoBERTa model from Hugging Face Transformers. Created a user-friendly UI with real-time updates and ensured seamless cross-origin communication using Flask-CORS. Optimized performance and accuracy with SoftMax and robust backend design.;
    Housing Price Predictor-Python, Streamlit, Scikit-learn, Pandas-Developed a web app to predict housing prices using a Random Forest model, with real-time user input and visualizations via Streamlit. Built robust preprocessing pipelines to handle categorical, numeric, and non-numeric data, ensuring accurate predictions. Visualized model performance metrics (RMSE, R²) and results, providing clear insights into model accuracy and predictions.;
    Weather App-Python, Flask, ReactJS, OpenWeatherMap API, Render-Developed a fully responsive web application using Flask as the backend, with a ReactJS frontend for an interactive user experience. Integrated the OpenWeatherMap API for real-time weather data, including temperature, humidity, sunrise-sunset times, and other weather conditions. Conducted extensive testing for functionality and cross-platform compatibility.;
    Portfolio Website-ReactJS, Bootstrap, Hugging Face Transformers, GitHub Pages-Built a responsive, modern portfolio website with ReactJS and Bootstrap, showcasing projects and skills with a clean, user-friendly design. Implemented an AI chatbot with Retrieval-Augmented Generation (RAG) using the Hugging Face API and the Meta-Llama model. The chatbot dynamically retrieves and integrates my personal information stored as vector embeddings, enabling personalized and context-aware responses. Deployed on GitHub Pages for easy access and continuous updates.

work/professional experience : Software Developer at The Reynolds and Reynolds from Jan 2022 to July 2024; Led and collaborated on the development and maintenance of KeyTrak applications across Desktop, Web, and Mobile platforms using PostgreSQL, C#, .NET, React, TypeScript, and React Native. Drove seamless feature rollouts by implementing Agile practices and maintaining a robust CI/CD pipeline, ensuring efficient deployment. Developed RESTful APIs, adhering to SOLID principles for scalable and maintainable solutions. Strengthened software reliability through Jest-based unit testing and effective Git version control. Additionally, optimized databases and resolved critical production issues, significantly improving performance and reducing downtime.; 
    Tools and Technologies: PostgreSQL, PowerShell, C#, .Net, React JS, TypeScript, React Native, Jest, pgAdmin, Tortoise SVN, Visual Studio, Visual Code, Phabricator, Jenkins, Slack, Git, Github Actions.; 
    Successfully migrated the SVN repository to GitHub, improving collaboration and version control while streamlining workflows. Leveraged Git, GitHub, and custom scripts for an efficient migration process, enhancing software development practices. Additionally, transitioned CI/CD from Jenkins to GitHub Actions, optimizing deployment speed and reliability through automated pipelines. To further improve efficiency, developed a PowerShell script and console application to automate database updates, seamlessly integrating it into the CI/CD pipeline. This automation reduced manual intervention, increased reliability, and ensured smooth database updates, contributing to a more efficient development lifecycle."},
